            home_footer_intro_description1: '<p class="font15">Now will protect your purchase order from the weather by using bag or box during shipping.</p>',
            home_footer_intro_description2: '<p class="font14">- <b>NowMerchant</b> là ứng dụng quản lý đơn hàng cho các nhà hàng đối tác của dịch vụ đặt món tận nơi </p><p class="font14">\t- <b>Now.vn</b> luôn sẵn sàng hợp tác với các nhà hàng, quán ăn, cafe... để mở rộng kinh doanh cũng như gia tăng khách hàng. Hãy kết nối vào hệ thống đặt và giao hàng để giảm bớt chi phí quản lý, vận hành, marketing, công nghệ...\t<br>\tĐăng ký tham gia: <b><a href="mailto:info@deliverynow.vn" style="color:#464646;">info@deliverynow.vn</a></b></p><p class="font14">\t- Foody còn cung cấp Giải pháp quản lí nhà hàng <b>Foody POS</b> tích hợp sẵn <b>Now.vn</b>, chủ cửa hàng có thể theo dõi lượt đặt hàng/khách truy cập, cập nhật thông tin/hình ảnh/thực đơn cho Microsite cùng nhiều tính năng ưu việt khác. Đăng kí dùng thử miễn phí \t<a href="https://www.foodypos.vn" target="_blank">tại đây</a>!</p>',
            home_footer_intro_description3: '<p class="font15">To help you make money in your Free Time</p><p><span style="color: #D52F33;font-weight: bold;">Now</span> is seeking cooperation with individuals to deliver food from our merchants to our customers, we will provide mobile application, and some necessary tools for you to receive &amp; deliver, make more income in your Free Time <br>Join our Partners network  <a href="https://www.deliverynow.vn/tuyen-dung" style="color: #4D77A2; font-weight:bold">right here</a> or Email to <a href="mailto:jobs@gofast.vn" style="color: #4D77A2; font-weight:bold">jobs@gofast.vn</a> - or call to 0283 925 0169. </p>',
